import './App.css';
import Navbar from './Navbar';
import Slider from './Slider';
import { ProductList } from './ProductList';
import { Routes, Route } from "react-router-dom"

function App() {
  return (
    <div className="App">
      <Navbar />
      <Routes>
        <Route>
          <Slider />
          <ProductList />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
